script: |
  super -f text -I q1453.spq | sort > q1453.out

inputs:
  - name: q1453.spq
    data: |
      SELECT 94 * - col1 AS col1, - col0 * - + col2 AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT + ( - + col2 ) BETWEEN - col1 + + 67 AND col0;
  - name: tab1

outputs:
  - name: q1453.out
    data: |
      -1316	4896
      -4418	6188
      -470	5015
